def count_v_related(self) -> int:
    cnt = 0
    t0 = time()
    for v in self.tasks.nodes_to_query:
        self.gdb.number_of_edges(v, v)
        cnt += 1
        dt = time() - t0
        if dt > self.max_seconds_per_query:
            break
    return cnt

